import React, {memo} from 'react';
import PropTypes  from 'prop-types';
import Grid  from '../../../reactComponents/grid/Grid';
import  Skeleton  from '../../../reactComponents/skeleton/Skeleton';
import  getAllByDisplayValue  from '@testing-library/react';
import Card from '../../../reactComponents/card/Card'

function Board({dados}){
    const {cases,todayDeaths, recovered, deaths, todayCases} = dados
    const getValues =(value) => value ? value: <Skeleton variant="text" width={182} height={60} />
    return (
        <Grid container spacing={4}>
         <Grid item xs={12} md={3}>
          <Card value={getAllByDisplayValue(cases)} label="Total de casos no Pais" color="#5d78ff" />
          </Grid>   
         </Grid>

    )
}
export default Board
